ow.'=>'Ang imong password reset link kay nawad-an nag bisa. Palihog maghangyo ug bag-ong link sa ubos.','Your server is running PHP version %1$s but WordPress %2$s requires at least %3$s.'=>'Ang imong server nagadagan sa PHP bersyon %1$s pero ang WordPress %2$s nagapangita nga makaabot %3$s.','Your session has expired. You can log in again from this page or go to the login page.'=>'Wala nay bisa imong sesyon. Pwede ka mulog in usab gikan sa kani nga pahina o muadto sa pahina sa paglog in.','Your site at <a href="%1$s">%2$s</a> is active. You may now log in to your site using your chosen username of &#8220;%3$s&#8221;. Please check your email inbox at %4$s for your password and login instructions. If you do not receive an email, please check your junk or spam folder. If you still do not receive an email within an hour, you can <a href="%5$s">reset your password</a>.'=>'Ang imong site sa <a href="%1$s">%2$s</a> kay aktibo. Pwede na nimo i-log in karon sa imong site gamit ang imong gipili nga username &#8220;%3$s&#8221;. Palihog tsek sa imong email inbox sa %4$s para sa imong password ug login nga instruksyons. Kung wala nimo nadawat ang email, palihog imong tsek sa imong daan o spam nga sudlanan. Kung wala gihapon nimo nadawat ang email sa sulod sa usa ka oras, pwede nimo <a href="%5$s">reset your password</a>.','Your site&#8217;s most recent Posts.'=>'Pinakabag-o nga posts sa imong site.','Your site&#8217;s most recent comments.'=>'Ang mga pinaka bag- nga komento sa imong site.','Your theme supports %s menu. Select which menu appears in each location.'=>'Ang imong tema nagasuporta sa %s menu. Pili kung unsa nga menu ang makit-an sa lokasyon.' . "\0" . 'Ang imong tema nagasuporta sa %s mga menu. Pili kung unsa nga menu ang makit-an sa lokasyon.','Your theme supports a static front page.'=>'Imong tema kay nagasuporta sa static front nga pahina.','Your theme supports one menu. Select which menu you would like to use.'=>'Ang imong tema nagasuporta ug usa ka menu. Pili ku